postArr.each{|x| x.each{|y| newArr[counter].push(y.tr_s('"', ''))}; counter+=1}

newArr.each{|x| thisCode=x[1]+x[4]; target=County.where(:full_code=>thisCode).last.id; Town.create(:code=>x[6],:full_code=>x[0],:name=>x[7],:county_id=>target,:urban=>x[8],:population=>x[15],:height=>x[13])}